function Progress({index , numQuestion , points}) {
    return (
        <header className="progress">
            <p>Questions <strong>{index + 1}</strong>/ {numQuestion}</p>
            <p><strong>{points}</strong>/{totalPoints}</p>
        </header>
    )
}

export default Progress
